ll of ice for volume & some yogurt. Not the place to go if you wanted a healthy fruit portion.', 'time': 1690023301, 'translated': False}, {'author_name': 'Honey Bee', 'author_url': 'https://www.google.com/maps/contrib/110309338963086929024/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a/ACg8ocIW-vk7eagat7Z3VFFRGqiY6uQOscB_U01b4byS-xBv=s128-c0x00000000-cc-rp-mo', 'rating': 1, 'relative_time_description': 'a month ago', 'text': 'How i can say to this outlet ?not good at keeping the shop clean !! the store is full of cockroaches !! how do you make water if the store is full of cockroaches? I cannot brain . I reject to buy boost anymore !', 'time': 1694936824, 'translated': False}, {'author_name': 'Eric', 'author_url': 'https://www.google.com/maps/contrib/105684176974873426874/reviews', 'language': 'en', 'original_language': 'en', 'profile_photo_url': 'https://lh3.googleusercontent.com/a-/ALV-UjX8t8N7v2_Iz_6aw7lLuAz3bpFEWPLN8UuFJCBVmh5lLrU=s128-c0x00000000-cc-rp-mo-ba4', 'rating': 2, 'relative_time_description': '4 years ago', 'text': "Today I ordered Red Royale Premium consisting of raspberries, blueberries, strawberries, banana, dates, apple, pineapple, beetroot, coconut water and ICE.

Being health conscious, I can't understand why they need to ADD ICE to a fruit juice drink. To dilute the drink? To add less ingredients? If you look at the list of fruits again, it's alot of fruits but I felt the taste did not turn out as claimed by the many ingredients. I felt cheated.

